function calcFisher(inpArr, nValue1Prev, nFishPrev) {
    let xHL2 = inpArr.at(-1)
    let xMaxH = Math.max(...inpArr)
    let xMinL = Math.min(...inpArr)
    let nValue1 = 0.33 * 2 * ((xHL2 - xMinL) / (xMaxH - xMinL) - 0.5) + 0.67 * nValue1Prev

    let iff_1 = nValue1 < -0.99 ? -0.999 : nValue1
    let nValue2 = nValue1 > 0.99 ? 0.999 : iff_1

    let nFish = 0.5 * Math.log((1 + nValue2) / (1 - nValue2)) + 0.5 * nFishPrev

    this.nValue1Prev = nValue1
    this.fishVal = nFish

}

